.
 Este miércoles falleció el que, para mí, fue el mejor Contrabajista del mundo: el señor Rinat Ibragimov. Recuerdo que cuando estaba en el Conservatorio hace unos años (creo que 4, estaba cursando Iniciación 2 de Contrabajo) el pianista acompañante del curso me dijo: "mirá que vos no tocás trompeta, eh. Tocás Contrabajo. Tenés que escuchar piezas de tu instrumento, pibe". Tomé muy en serio lo que me dijo y, apenas llegué a casa, me puse a buscar conciertos para Contrabajo. Había escrito algo así como "Diseldorf concierto". No tenía idea de nada.
 Ahí me salió el primer resultado (además de la corrección ortográfica "Dittersdorf") donde apareció por primera vez en mi vida el nombre Rinat. Después de ese video donde él tocaba me dije: "Esto es lo que quiero hacer. Quiero ser el solista de la Sinfónica de Londres".
Cerca o muy lejos de esa visión, hoy no hay día en el que estudie sin pensar en ser de los mejores con el Contrabajo y llegar a Londres. Eso significa Rinat Ibragimov para mí: pasión y dedicación.

Ojalá este video sirva como una suerte de "homenaje" para él. Donde sea que estés, gracias por este sueño, Rinat (05/11/60- 02/09/20).
